           int ibin2 = ibin1+1;
           double dx = iv[ivar]-(xmin[ivar][cls]+0.001           * ibin1* (xmax[ivar][cls]-xmin[ivar][cls]));
           double eps=dx/(xmax[ivar][cls]-xmin[ivar][cls])*1000;
